import React from 'react';
import "./Home.css";

const Home = () => {
  return (
    <div>
      <div className='header'>
      <h1>Home Page</h1>
      <nav className='navbar'>
        <button className='btn btn-1'>Home</button>
        <button className='btn btn-2'>Units</button>
      </nav>
      </div>
    </div>
  )
};

export default Home;
